/************************************ Fetch All Dream Team  ************************************/
const fetchAllDreamTeams = async user => {
  if (!user) {
    console.error('User data is missing');
    throw new Error('User data is missing');
  }
  try {
    const response = await axios.get('/api/dreamteam/all', {
      headers: {
        Authorization: `Bearer ${user.token}`
      }
    });
    const dreamTeamsData = response.data;
    const updatedDreamTeams = dreamTeamsData.map(team => {
      const players = [];
      Object.values(JsonData).forEach(conference => {
        Object.values(conference).forEach(division => {
          Object.values(division).forEach(teamData => {
            teamData.forEach(player => {
              if (team.player_ids.includes(player.id.toString())) {
                players.push(player);
              }
            });
          });
        });
      });
      const avgPPG = (players.reduce((sum, player) => sum + player.ppg, 0) / players.length).toFixed(1);
      const avgRPG = (players.reduce((sum, player) => sum + player.rpg, 0) / players.length).toFixed(1);
      const avgAPG = (players.reduce((sum, player) => sum + player.apg, 0) / players.length).toFixed(1);
      return {
        ...team,
        players,
        avgPPG,
        avgRPG,
        avgAPG
      };
    });
    const stats = {
      bestPPG: Math.max(...updatedDreamTeams.map(team => parseFloat(team.avgPPG))),
      worstPPG: Math.min(...updatedDreamTeams.map(team => parseFloat(team.avgPPG))),
      bestRPG: Math.max(...updatedDreamTeams.map(team => parseFloat(team.avgRPG))),
      worstRPG: Math.min(...updatedDreamTeams.map(team => parseFloat(team.avgRPG))),
      bestAPG: Math.max(...updatedDreamTeams.map(team => parseFloat(team.avgAPG))),
      worstAPG: Math.min(...updatedDreamTeams.map(team => parseFloat(team.avgAPG)))
    };
    return {
      updatedDreamTeams,
      bestStats: {
        bestPPG: stats.bestPPG.toFixed(1),
        bestRPG: stats.bestRPG.toFixed(1),
        bestAPG: stats.bestAPG.toFixed(1)
      },
      worstStats: {
        worstPPG: stats.worstPPG.toFixed(1),
        worstRPG: stats.worstRPG.toFixed(1),
        worstAPG: stats.worstAPG.toFixed(1)
      }
    };
  } catch (error) {
    console.error('Error fetching dream teams:', error);
    throw error;
  }
};

